import React from "react";
import { BrowserRouter } from "react-router-dom";

import './Detail.css';
const Detail = () =>{
    return(
        <BrowserRouter>
      <Routes>
          <Route path="/detail" element={<Detail />}/>
      </Routes>
        </BrowserRouter>
    )
}

export default Detail
